import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super()
    this.state = {
      champs:[]
    }
    this.getChamp = this.getChamp.bind(this);
  }

  componentDidMount(){
    this.getChamp()
  }

  getChamp() {
    fetch('http://ddragon.leagueoflegends.com/cdn/10.5.1/data/en_US/champion.json')
    .then(response => response.json())
    .then(champ => {
      let list = []
      Object.entries(champ.data).forEach((item, i) => {
         list.push(item[1]);
       })
       this.setState({
         champs: list
       })
       console.log(this.state.champs);
  })
  .catch(error => console.log('Champion not found!', error))
}

  render (){
    return(<div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>)
  };
}

export default App;
